                Portfolio
            </NavLink>
            <NavLink variant="body1" href='/informace'>
                Informace
            </NavLink>
            <NavLink variant="body1" href='/cenik'>
                Cen√≠k
            </NavLink>
            <NavLink variant="body1" href='/kontakt'>
                Kontakt
            </NavLink>
        </>
    );
};

export default ItemOfNav;
